		"text": "📣판매 공지\n재미공작소 2020년 달력 #컬러링컬러링캘린더 \n재미공작소 스마트스토어에서 판매 시작했습니다. \n\n컬러-링을 이용해 그림과 달력을 이어서 걸거나,\n달력의 그림을 컬러링으로 채울 수 있는 재미있는 달력!\n구경하러 가보실까요😉\n\nhttps://t.co/qKZ7TNZ9rC https://t.co/rZ2iqNWBWD"
