		"text": "강유가람 감독님이 이야기하는 영화 &lt;이태원&gt;의 이야기\n영상으로 확인!💁🏻\n\n영화 &lt;#이태원&gt;은\n이후 IPTV, 다운로드, 스트리밍서비스, DVD 등의\n2차 공개 없이 오로지 극장에서만 만날 수 있습니다.\n#상상마당시네마\n\n좋은 영화를 오래 볼 수 있도록\n많은 관심과 성원 부탁드려요:) https://t.co/ZaqrcuYSbP"
